@bmortech_official just dropped the LEEO this one is compact with good airflow 🔥
Bmor LEEO Pod System is a new arrival open pod kit. 2ml refillable cartridge adopts a 1.0ohm mesh coil and LEMT Technology inside the pod,LEEO gives you the most original Vaping experience in every single Puff. Powered by a 400mAh battery, rechargeable via Type-C fast charging port. LEEO comes with a button for active draw and Auto-draw dual vaping mode. Choose your Vaping mode and way! Instead of keeping the device on, you can easily turn the LEEO on/off by pressing the Button 5 times. LEEO has 360-degree adjustable side airflow to adjust for a perfect puff and vape it on your preference. LEEO is design with upgraded side-fill-Ing leakage-proof design, cartridge Plug fits tightly into the device to pre- Vent oil leakage
I’ll be posting a video with this one next stay tuned !!

